-- ----------------------------
-- Table structure for sa_trc_blocks
-- ----------------------------
DROP TABLE IF EXISTS `sa_trc_blocks`;
CREATE TABLE `sa_trc_blocks`  (
  `id` int UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '记录ID',
  `block_number` int UNSIGNED NOT NULL COMMENT '区块高度',
  `block_hash` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '区块哈希',
  `parent_hash` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '父区块哈希',
  `transaction_count` int NOT NULL DEFAULT 0 COMMENT '区块交易数目',
  `block_time` datetime NOT NULL COMMENT '区块时间',
  `raw_data` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL COMMENT '区块原始数据(JSON格式)',
  `size` int NOT NULL DEFAULT 0 COMMENT '区块大小(字节)',
  `witness_address` varchar(42) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '见证人地址',
  `witness_signature` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL COMMENT '见证人签名',
  `energy_used` int NOT NULL DEFAULT 0 COMMENT '消耗的能量',
  `energy_limit` int NOT NULL DEFAULT 0 COMMENT '能量限制',
  `merkle_root` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '默克尔根',
  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `delete_time` datetime NULL DEFAULT NULL COMMENT '删除时间',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `block_number`(`block_number` ASC) USING BTREE,
  UNIQUE INDEX `block_hash`(`block_hash` ASC) USING BTREE,
  INDEX `parent_hash`(`parent_hash` ASC) USING BTREE,
  INDEX `block_time`(`block_time` ASC) USING BTREE,
  INDEX `witness_address`(`witness_address` ASC) USING BTREE,
  INDEX `created_at`(`create_time` ASC) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 9099 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci COMMENT = 'Tron区块记录表' ROW_FORMAT = DYNAMIC;

