-- ----------------------------
-- Table structure for sa_trc_transactions
-- ----------------------------
DROP TABLE IF EXISTS `sa_trc_transactions`;
CREATE TABLE `sa_trc_transactions`  (
  `id` int UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '记录ID',
  `wallet_id` int UNSIGNED NOT NULL COMMENT '关联钱包ID',
  `transaction_type` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '动账类型(energy_receive:接收能量, trx_in:TRX入账, trx_out:TRX出账, usdt_in:USDT入账, usdt_out:USDT出账)',
  `amount` decimal(20, 6) NOT NULL DEFAULT 0.000000 COMMENT '动账金额',
  `fee` decimal(20, 6) NOT NULL DEFAULT 0.000000 COMMENT '手续费',
  `transaction_hash` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '交易哈希',
  `from_address` varchar(42) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '发送地址',
  `to_address` varchar(42) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '接收地址',
  `block_number` int UNSIGNED NULL DEFAULT NULL COMMENT '区块号',
  `transaction_time` datetime NULL DEFAULT NULL COMMENT '交易时间',
  `remark` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '备注',
  `transaction_status` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '交易状态',
  `notify_status` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '通知状态',
  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `delete_time` datetime NULL DEFAULT NULL COMMENT '删除时间',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `wallet_id`(`wallet_id` ASC) USING BTREE,
  INDEX `transaction_type`(`transaction_type` ASC) USING BTREE,
  INDEX `transaction_hash`(`transaction_hash` ASC) USING BTREE,
  INDEX `from_address`(`from_address` ASC) USING BTREE,
  INDEX `to_address`(`to_address` ASC) USING BTREE,
  INDEX `block_number`(`block_number` ASC) USING BTREE,
  INDEX `transaction_time`(`transaction_time` ASC) USING BTREE,
  INDEX `created_at`(`create_time` ASC) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci COMMENT = '钱包动账记录表' ROW_FORMAT = DYNAMIC;

